    label_isHHBB_rule1: '《飞禽走兽》是移植自经典街机的轮盘游戏，每一局时长为30S。游戏玩家可以在游戏过程中任意选择自己喜欢的区域投放筹码。游戏开始后灯号会开始转动，几圈以后灯号会停下，灯号所停位置就代表此次游戏开奖结果。玩家投中后，即可获得相应的奖金。',
