    label_isHHBB_rule5: '4.每天局数：每天2880局。第一局开始时间为：00:00:00 (实际以游戏服务端启动时间为准，同时中途游戏中断或者暂停，局数将根据上一局游戏的局数+1，开始下一局游戏)',
