    label_LK28_mix2_eg: '如：下注大单，开奖号码为889，和为25大于等于14且为奇数，即为中奖。',
    label_LK28_mix3_exp: '三个位置数值相加小于等于13且为奇数为小单，小于等于13且为偶数为小双。',
    label_LK28_mix3_eg: '如：下注小单，开奖号码为012，和为3小于等于13且为奇数，即为中奖。',
